import React from 'react';

import PrivateHeader from './PrivateHeader';

export default class Dashboard extends React.Component {
  render() {
    return (
  		<div>
  			<PrivateHeader title="Dashboard"/>
  			<div className="page-content">
  				Dashboard page content.
  			</div>
  		</div>
  	);
  }
};
